import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {
    BrowserRouter as Router,
  } from "react-router-dom";
  

const Navigator = () => (
    <Router>
        <div>
            <App />
        </div>
    </Router>
)
 ReactDOM.render(
    <Router>
    
        <App />
    
    </Router>   ,
     document.getElementById('root')
 )
